<style>
/* A's Resume Loader */

/* circle animation loader */
 #loading-Div {
            position:fixed;;
            top:0;
            left:0;
            width:100%;
            height:100%;
            background-color:#fff;
            z-index:9999;
            text-align: center;
        }
        
	.loadthis{
		position:relative;
		top:35%;
	}
 #circle{
        
         -webkit-transform: translateZ(0);
            -ms-transform: translateZ(0);
            transform: translateZ(0);
            -webkit-animation: loadcircle 2.5s infinite linear;
            animation: loadcircle 2.5s infinite linear;
            position:relative;
            transform-origin: 50% 50%;
    }  
    
    #text{
        -webkit-animation: loadtext 1.3s infinite ease-in-out ;
        animation: loadtext 1.3s infinite ease-in-out ;
        transform-origin: 50% 50%;
        opacity:1;
        
    }
    
     @-webkit-keyframes loadcircle {
            0% {
                -webkit-transform: rotateZ(0deg);
                transform: rotateZ(0deg);
            }
            100% {
                -webkit-transform: rotateZ(360deg);
                transform: rotateZ(360deg);
            }
        }
        @keyframes loadcircle {
            0% {
                -webkit-transform: rotateZ(0deg);
                transform: rotateZ(0deg);
            }
            100% {
                -webkit-transform: rotateZ(360deg);
                transform: rotateZ(360deg);
            }
        }
    
    
/*    text animation*/
     @-webkit-keyframes loadtext {
              0% {
                    opacity:0.6; 
            }
             50% {
                -webkit-transform: scale(0.9); opacity:0.6; 
                transform:scale(0.9); opacity:0.6; 
            }

          100% {
                -webkit-transform:scale(1.3) ;opacity:1;fill:orange;
                transform:scale(1.3); opacity:1; fill:orange;
            }
            
        }
     @keyframes loadtext {
            0% {
                    opacity:0.6; 
            }
             50% {
                -webkit-transform: scale(0.9); opacity:0.6; 
                transform:scale(0.9); opacity:0.6; 
            }

          100% {
                -webkit-transform:scale(1.3);opacity:1;fill:orange;
                transform:scale(1.3); opacity:1; fill:orange;
            }

        }

   
  </style> 
   
   <script>

$(window).on('load', function(){
  setTimeout(removeLoader, 500); //wait for page load PLUS two seconds.
});
function removeLoader(){
    $( "#loading-Div" ).fadeOut(200, function() {

      $( "#loading-Div" ).addClass('hidden'); //makes page more lightweight 
      $( "#loading-Div" ).remove();
      })
      }
</script>